import React from 'react'
import { CharaList } from '../helpers/charalist'
function Charas() {
  return (
    <div class='Characters'>
        <h1>
            Characters
        </h1>
        <div className="charalist">
             {CharaList.map((charitem, key)=>{
                return <div>{charitem.name}</div>;})}
        </div>
    </div>
  );
}

export default Charas
